import React from 'react'
import {SiPython} from 'react-icons/si'
import Tutorial from '../Tutorial'
const Python1 = () => {
    return (
        <div>
            <Tutorial icons = {<SiPython/>} name = "PYTHON" language = "python"/>
        </div>
    )
}

export default Python1
